import React from 'react';
import { NavLink } from 'react-router-dom';
import '../css/nav.css';

const Nav = () => {
    return (
        <div className='nav-bar'>
            <li><NavLink to="/"><a>CKCG AVION</a></NavLink></li>
            <ul>
                <li><NavLink to="/"><a>Accueil</a></NavLink></li>
                <li><NavLink to="/Club"><a>Le Club</a></NavLink></li>
                <li><NavLink to="/Services"><a>Services</a></NavLink></li>
                <li><NavLink to="/Gallerie"><a>Gallerie</a></NavLink></li>
               <li><NavLink to="/Contact"><a>Contact</a></NavLink></li>
            </ul>
            <li><NavLink to="/Connexion"><a></a>Se connecter/S'inscrire</NavLink></li>
        </div>
    );
};

export default Nav;
